import { useState } from 'react'

const App = () => {
  const [ counter, setCounter ] = useState(0)

  const IncreaseCount = (props) => {
    setCounter(props.counter + 1)
  }
  const setZero = () => setCounter(0)

  return (
    <div>
      <button onClick={increaseCount}>Click {counter}</button>
      <button onClick={setZero}>Reset</button>
    </div>
  )
}

export default App
